package string.easy;

import java.util.*;

//Completed GFG - correct
public class NonRepeatingCharacter
{
    static class Pair
    {
        int index;
        int count;

        public Pair(int index,int count)
        {
            this.index = index;
            this.count = count;
        }
    }
    public static void main(String[] args)
    {
        //System.out.println(nonrepeatingCharacter(""));
        System.out.println(nonrepeatingCharacter("zxvczbtxyzvy"));
    }
    static char nonrepeatingCharacter(String S)
    {
        LinkedHashMap<Character, Pair> map = new LinkedHashMap<>();
        for(int i = 0;i<S.length();i++)
        {
            if(map.containsKey(S.charAt(i)))
            {
                var p = map.get(S.charAt(i));
                p.index = i;
                p.count = p.count+1;
                map.put(S.charAt(i),p);
            }
            else
                map.put(S.charAt(i),new Pair(i,1));
        }
        int min = Integer.MAX_VALUE;
        char ans = ' ';
       for(Map.Entry<Character,Pair> entry : map.entrySet())
       {
           var pair = entry.getValue();
           if(pair.count == 1)
           {
               if(pair.index < min)
               {
                   min = pair.index;
                   ans = entry.getKey();
               }
           }
       }
       return min == Integer.MAX_VALUE ? '$' : ans;
    }
}
